import { useState, useEffect} from 'react';
import { CSAPIInstance } from './classes/CounterStrikeApi';



function App() {

  const [text, setText] =  useState<string>("");
  const [img, setImg] = useState<string>("");
  const [num, setNum] = useState<number>(0);

  const [image, setImage] = useState<string>("");
  const [pricemed, setPriceMed] = useState<number>(0);

  const increment = () => {
    setNum(num + 1);
  }

  useEffect(() => {

    let img_:string = "";
    let text_:string = "N/A";

    let image_ = "";
    let pricemed_ = 0;

    CSAPIInstance.fetchItemStats("AWP | Oni Taiji (Factory New)")
      .then((val => {
        if(val != null){

          image_ = val.image;
          pricemed_ = val.pricemedian;
          setImage(image_);
          setPriceMed(pricemed_);

        }
      }))

    CSAPIInstance.fetchRandomProfiles(1).then((val) => {
      if(val != null){
        text_ = val.username;
        img_ = val.fullAvatarImg;
        setText(text_);
        setImg(img_);
      }
    });

  }, [num])

  return (
    <div>
      hello
      {text}
      <img src={img} />
      <button onClick={increment}>thisbeabutton</button>
      ________
      <div className="standard-box">
        <img src={image} />
      </div>
      {pricemed}

    </div>
  );
}

export default App;
